import React from "react";
import "../../App.css";

export default function LogIn() {
  return (
    <div className="input-areas">
      <form>
        <input
          className="footer-input"
          name="email"
          type="email"
          placeholder="Your Email"
        />
      </form>
    </div>
  );
}
